जीएसटी काउंसिल द्वारा स्वीकृत ‘#NextGenGst सुधार’ से सभी वर्गों को प्रत्यक्ष लाभ मिलेगा। इस ऐतिहासिक निर्णय से मध्यम वर्ग के करोड़ों परिवारों को बड़ी राहत और अर्थव्यवस्था को नई गति मिलेगी। आदरणीय प्रधानमंत्री श्री नरेंद्र मोदी जी के नेतृत्व में लिया गया यह कदम भारत की प्रगति की दिशा तय करने वाला है।
