स्वतंत्र भारत के इतिहास में 2017 में जीएसटी लागू होने के पश्चात, 2025 में आदरणीय प्रधानमंत्री श्री नरेंद्र मोदी जी के लाल किले के प्रचीर से किए गए दूरदृष्टिपूर्ण उद्घोष के अनुरूप, माननीय वित्त मंत्री श्रीमती निर्मला सीतारमण जी की अध्यक्षता में जीएसटी 2.0 का निर्णय लिया गया है। यह स्वतंत्र भारत का दूसरा सबसे बड़ा आर्थिक सुधार है। मेरे लिए यह गर्व और सौभाग्य का विषय है कि मैं उस जीएसटी काउंसिल का सदस्य रहा, जिसने इस अभूतपूर्व निर्णय को मूर्त रूप प्रदान किया।

रोजमर्रा की कई आवश्यक वस्तुओं पर जीएसटी शून्य कर दिया गया। सैकड़ों वस्तुओं पर 12% से घटकर 5% और 28 % से घटकर 18% कर दिया गया है। जिससे मध्यम वर्गीय परिवारों को बड़ी राहत मिलेगी। टेक्सटाइल, हेल्थकेयर, शिक्षा और कृषि उपकरण जैसे रोजगार सृजन करने वाले सेक्टरों को भी लाभ होगा। यह ऐतिहासिक निर्णय महंगाई कम करेगा, जनता की खरीद क्षमता बढ़ाएगा और अर्थव्यवस्था को नई गति देगा।

